import styles from './QuestionCategoryList.module.css'

const QuestionCategoryList = ({ title, show, visibility }) => {
    return (
        <div className={styles.tile}>
            <ul>
                <li style={{display: visibility}} onClick={show}>{title}</li>
            </ul>
        </div>
    )
}

export default QuestionCategoryList
